import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { Col, Row} from 'react-flexbox-grid'

class RecipeSearchButtons extends Component {
    render() {
        const {searchRecipesByRate} = this.props
        return (
            <>
                <div className="">
                    <button className="btn btn-success mr-3" onClick={() => searchRecipesByRate([4, 5])}>Best Recipes</button>
                </div>
                <div>
                    <button className="btn btn-danger mr-3" onClick={() => searchRecipesByRate([1, 2, 3])}>Worst Recipes</button>
                </div>
                <div>
                    <button className="btn btn-primary" onClick={() => searchRecipesByRate([1, 2, 3, 4, 5])}>See all scored</button>
                </div>
            </>
        );
    }
}

RecipeSearchButtons.propTypes = {
    searchRecipesByRate: PropTypes.func.isRequired,
};

export default RecipeSearchButtons;
